import React from 'react'

const Journal = () => {

    return (
        // import NoteContext from '../Context/notes/NoteContext'

        <>
            <div style={{ display: "inline" }}>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Inventore, hic quo dicta at magnam ratione harum fugiat adipisci natus dolor optio, iure quasi repellendus ipsam, ipsa ea omnis officia perferendis?</p>
            </div>
            <div className="jrn" style={{ width: '500px', display: "inline" }}>
                <form>

                    <div className="mb-3">
                        <label htmlFor="description" name="description" className="form-label" >Your Today's Journal</label>
                        <input type="text" name="description" className="form-control" id="description" style={{ height: '300px' }}
                            required minLength={5} />
                    </div>


                    <button type="submit" className="btn btn-primary" >Add Journal</button>
                </form>

            </div>

        </>




    )
}
export default Journal;
